    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Catahoula NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Catahoula NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a summary of Refuge resources, and information
    on the management direction and implementation. Key planning issues include: wildlife
    and habitat management, resource protection, visitor services, and refuge administration.",nt"license_title":
